/*Table structure for table `prendastipos` */

DROP TABLE IF EXISTS `prendastipos`;

CREATE TABLE `prendastipos` (
  `idprendastipos` int(11) NOT NULL AUTO_INCREMENT,
  `prendas_id` int(11) DEFAULT NULL,
  `ID_Talla` int(11) DEFAULT NULL,
  `precio` float DEFAULT NULL,
  `stock` int(11) DEFAULT NULL,
  PRIMARY KEY (`idprendastipos`),
  KEY `prendas_id` (`prendas_id`),
  KEY `ID_Talla` (`ID_Talla`),
  CONSTRAINT `prendastipos_ibfk_1` FOREIGN KEY (`prendas_id`) REFERENCES `prendas` (`prendas_id`),
  CONSTRAINT `prendastipos_ibfk_2` FOREIGN KEY (`ID_Talla`) REFERENCES `talla` (`ID_Talla`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

