/*Table structure for table `productos` */

DROP TABLE IF EXISTS `productos`;

CREATE TABLE `productos` (
  `producto_id` int(11) NOT NULL AUTO_INCREMENT,
  `nombre` varchar(50) DEFAULT NULL,
  `descripcion` varchar(255) DEFAULT NULL,
  `precio` decimal(10,2) DEFAULT NULL,
  `stock` int(11) DEFAULT NULL,
  `proveedor_id` int(11) DEFAULT NULL,
  `ID_Talla` int(20) DEFAULT NULL,
  `Imagen` blob DEFAULT NULL,
  PRIMARY KEY (`producto_id`),
  KEY `proveedor_id` (`proveedor_id`),
  KEY `ID_Talla` (`ID_Talla`),
  CONSTRAINT `productos_ibfk_1` FOREIGN KEY (`proveedor_id`) REFERENCES `proveedores` (`proveedor_id`),
  CONSTRAINT `productos_ibfk_2` FOREIGN KEY (`ID_Talla`) REFERENCES `talla` (`ID_Talla`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

