/* Procedure structure for procedure `Ps_Insertaruser` */

/*!50003 DROP PROCEDURE IF EXISTS  `Ps_Insertaruser` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `Ps_Insertaruser`(
    IN nom VARCHAR(150),
    IN apa VARCHAR(150),
    IN ama VARCHAR(150),
    IN correo VARCHAR(200),
    IN dir VARCHAR(150),
    IN col VARCHAR(150),
    IN idmuni INT,
    IN Sex VARCHAR(50),
    IN fechana DATE,
    IN tel VARCHAR(20),
    IN usu VARCHAR(50),
    IN pass VARCHAR(20),
    IN tip VARCHAR(50)
)
BEGIN      
    DECLARE IDD INT;
           
    INSERT INTO direcciones(colonia, idmunicipio) VALUES (col, idmuni);
           
    SET IDD = (SELECT MAX(direccion_id) FROM direcciones);
           
    INSERT INTO usuarios(nombre, apaterno, amaterno, email, direccion, direccion_id, Sexo, fechanacimiento, telefono, usuario, pasword)
    VALUES (nom, apa, ama, correo, dir, IDD, Sex, fechana, tel, usu, MD5(pass));
           
    INSERT INTO users(usuario, pasword, telefono, tipo) VALUES (usu, MD5(pass), tel, tip);

END */$$
DELIMITER ;

